INSERT INTO `email_template` VALUES (1,'68KCh0tH40689a5a3d773c0e66c9ebf17fa1ddfd2M5czj3tVX','signup_activation',1,'Thank you for signing up','<p>Hello {{first_name}}!</p><p>Thank you for signing up for Vocal Chimp!</p><p>Simply Input Your Text and Download an Artificial Intelligence Created, Human-Sounding Voiceover.</p><p>You may sign into your account <a href=\"https://app.vocalchimp.com/auth/signin\" target=\"_blank\">clicking here</a>.</p>'),(2,'Sm1M50EX7c92c02f0db2d4d0b57958b7a5897ac4e6Lm2nECNP','reset_password',1,'Password reset','<p>Hello!</p><p>We\'ve generated a URL to reset your password. If you did not request to reset your password, simply ignore this email and nothing will happen.</p><p>You can reset your password by clicking the following URL:<br>{{verification_url}}</p><p>If clicking the URL above does not work, copy and paste the URL into a browser window. The URL will only be valid for a limited time.</p><p>Thank you,</p><p>VocalChimp</p>'),(3,'y4Y8hpRW1f21144be085fec47b9380fca78dbdb885xvEcLYdP','change_email',1,'Verify your email address','<p>Hello!</p><p>We\'ve generated a URL to change your email address. If you did not request to change your email address or if you\'ve changed your mind, simply ignore this email and nothing will happen.</p><p>You can change your email address by clicking the following URL:<br>{{verification_url}}</p><p>If clicking the URL above does not work, copy and paste the URL into a browser window. The URL will only be valid for a limited time and will expire.</p><p>Thank you,</p><p>CyberBukit Membership Support<br>https://membership.demo.cyberbukit.com</p>'),(4,'jSwbWZdAeef79225efbec3e064b048f20eaa7bb9cwnYX4SWrG','notify_email',1,'Your account has been created','<p>Hello {{first_name}}!</p><p>Welcome to VocalChimp!</p><p>Your VocalChimp account has been created successfully!</p><p>Here are your signin credentials:<br>Email Address: {{email_address}}<br>Password: {{password}}<br>Signin URL: {{base_url}}<br>Please sign in and change your password. If you have any questions please feel free to contact us.</p><p>VocalChimp</p>'),(5,'nIQMARFoda2cade675a5876feb1bb77ad4db0086aH6MghaBPL','invite_email',1,'Signup Invitation','<p>Hello!</p><p>The administrator of CyberBukit Membership has sent you this email to invite you to sign up as our member.</p><p>Please click the following URL to activate your account:<br>{{verification_url}}</p><p>If clicking the URL above doesn\'t work, copy and paste the URL into a browser window.</p><p>CyberBukit Membership Support<br>https://membership.demo.cyberbukit.com</p>'),(6,'pW5oGbDQHf7ecf4013f762df420bffe8011b18616mDIwCxvMA','2FA_email',1,'Two Factor Authentication','<p>Your CyberBukit Membership verification code is {{code}}</p>'),(7,'tzqM8x3p7174d8c2d251203aaeeaa85fe4d6ad8338BhC0Oq5W','ticket_notify_agent',1,'A new ticket raised','<p>A new ticket raised or updated. Please sign in and check.</p>'),(8,'8HKUnZ5F24a9ce26849ee64dcba7aaa2187950d40vHQYtzcsK','ticket_notify_user',1,'Your ticket has been replied','<p>Dear customer,</p><p>You ticket has been replied by our agent(s). Please sign in and check.</p><p>CyberBukit Membership Support</p><p>https://membership.demo.cyberbukit.com</p>'),(9,'5DQa8U2Ig7810ecd10382727e3c8f9be866362547OaCI8ki3t','pay_success',1,'We have received your payment','<p>Thank you for subscribing to VocalChimp.com</p><p>We have received your payment and your account is active.</p><p><b>You can login to your account by <a href=\"https://app.vocalchimp.com/auth/signin\" target=\"_blank\">clicking here</a>.</b></p><p>If you have any questions please contact us at <a href=\"mailto:support@vocalchimp.com\" target=\"_blank\">support@vocalchimp.com</a></p>');
