vices to you. All Your personal information and billing information (if applicable) provided to Us pursuant thereto shall be processed in accordance with Our Privacy Policy.<\\/p>\\r\\n<h4 xss=removed>2. <strong>User Conduct and Obligations<\\/strong><\\/h4>\\r\\n<p xss=removed>You agree and undertake to Us that you shall:<\\/p>\\r\\n<p xss=removed>(a) not use Our Services for any illegal or unauthorized purpose;<\\/p>\\r\\n<p xss=removed>(b) not abuse, harass, threaten, or intimidate other users of the Services;<\\/p>\\r\\n<p xss=removed>(c) not reverse engineer, decompile or disassemble Our Services;<\\/p>\\r\\n<p xss=removed>(d) not copy, modify, adapt or hack Our Website and Services;<\\/p>\\r\\n<p xss=removed>(e) not rent, lease, sublicense, sell, assign, a loan or otherwise transfer the Services;<\\/p>\\r\\n<p xss=removed>(f) not upload, transmit or distribute any viruses, worms, or invalid data to Our Services and other users;<\\/p>\\r\\n<p xss=removed>(g) not use Our Services to promote discrimination, hostility or violence;<\\/p>\\r\\n<p xss=removed>(h) not impersonate another person or otherwise mispresenting your affiliation with a person conducting fraud, hiding or attempting to hide your identity;<\\/p>\\r\\n<p xss=removed>(i) be responsible for your conduct and activities on the use of Our Services (including, any activity that occurs under Your account); and\\/or<\\/p>\\r\\n<p xss=removed>(j) only use Our Services to produce, create, or reproduce works provided always that such production, creation or reproduction derives from materials which you own the copyright or materials you are legally authorized or licensed to use;<\\/p>\\r\\n<p xss=removed>failing which, We reserve the right to discontinue, suspend or terminate Our Services to you and you shall irrevocably and unconditionally indemnify Us against all claims in accordance with Clause 11. You further agree not to hold Us liable for any direct or indirect losses or damages howsoever incurred by 