prove that We reserve the right to change Our Fees at any time, at Our sole discretion, upon notice to you if such changes affect your existing subscription. If you received a discount for a subscription fee, or any other promotional offer for a subscription fee We shall have the right to renew your subscription automatically and without further notice at the full applicable Fee.<\\/p>\\r\\n<p><div xss=removed><span xss=removed>(c) One Time Fee & Refunds<\\/span><\\/div><div xss=removed><span xss=removed>If you believe that you were charged in error, you may provide a written notice to <\\/span><a href=\\\"mailto:Info@vocalchimp.com\\\" xss=removed>Info@vocalchimp.com<\\/a><span xss=removed> to request to cancel the Fee. Eligibility to cancel a Fee will be assessed by Us based on a number of factors, including without limitation, violations to Our License Agreement and improper usage of Our Services.<\\/span><\\/div><\\/p>\\r\\n<p xss=removed>(d) Taxes and Currencies<\\/p>\\r\\n<p xss=removed>All Fees for the Services shall be in U.S Dollars, except when and as specifically stated otherwise by Us. You shall have full and sole responsibility for all taxes and fees of any nature associated with Our Fees and Services, including any sales tax related to the purchase or sale of Services.<\\/p>\\r\\n<p xss=removed>(e) Subscription<\\/p>\\r\\n<p xss=removed>In order to ensure that you do not experience an interruption of the Service due to the lapse of the subscription period, the subscription will be based on an auto-renewal basis whereby it will automatically be renewed upon the end of the applicable subscription period (i.e. monthly basis or yearly basis) corresponding to the term of your subscription.<\\/p>\\r\\n<p xss=removed>In the event your subscription begins on a day not contained in a given month, We shall bill you via the Payment Method on the last day of such month. For example, if you had subscribed to use Our Service and became a paying subscriber on 28 February, you shall be billed via the Payment Method on 31 March (if you had opted for a monthly subscription) or on 31 May (if you had opted for a quarterly subscription). You acknowledge that the timing of when you are billed and the amount billed via the Payment Method may vary, including for example due to free trials and other promotional offers, credits applied, changes in your subscription, and changes in applicable taxes, and you authorize us to charge you for the corresponding amounts.<\\/p>\\r\\n<p xss=removed>If We offer you a promotion (e.g., a promotional price) for your subscription, the specific terms of the promotion will be disclosed during your sign-up or in other materials provided to you describing the particular promotion. In the case of promotional pricing, after your promotion ends, We will begin billing you for your subscription at the regular price after the promotion ends unless you cancel prior to the end of the promotion or unless otherwise disclosed in communications made available to you.<\\/p>\\r\\n<h4 xss=removed>4. <strong>Cancellation of Subscription and Account Deletion<\\/strong><\\/h4>\\r\\n<p xss=removed>(a) Cancellation of Subscription<\\/p>\\r\\n<p xss=removed>You may discontinue to use and request the cancellation of your subscription at any time. We shall not be liable for reimbursing you of any cancellation of your subscription fee have been paid by you. For example, if you have paid for twelve (12) months upfront, such amount shall be deemed forfeited.<\\/p>\\r\\n<p xss=removed>You may cancel your subscription by going to \\u201cMy Account\\u201d and following the instructions as stated therein.<\\/p>\\r\\n<p xss=removed>(b) Account Deletion<\\/p>\\r\\n<p xss=removed>You may also delete your account by going to \\u201cMy Account\\u201d and following the instructions for the deletion of your account.<\\/p>\\r\\n<p xss=removed>Upon the closure of your account and under your specific instruction for data erasure, we shall take al