any such covenant would be inadequate. You further acknowledge and agree that the arbitral tribunal may order an interim measure it deems necessary or proper in accordance with the applicable laws of United States of America, including without limitation, any injunctive or enjoining procedural orders or interlocutory awards.<\\/p>\\r\\n<h3 xss=removed>Cookie Policy<\\/h3>\\r\\n<p xss=removed>JBAN MEDIA HOLDINGS, LLC. (\\u201c<strong>VOCALCHIMP.COM<\\/strong>\\u201d, \\u201c<strong>we<\\/strong>\\u201d, \\u201c<strong>us<\\/strong>\\u201d or \\u201c<strong>our<\\/strong>\\u201d), as data controller, uses Cookies to improve and tailor your online experience on vocalchimp.com (the \\u201c<strong>Website<\\/strong>\\u201d).<\\/p>\\r\\n<p xss=removed><strong>a) What are Cookies and how do they work?<\\/strong><\\/p>\\r\\n<p xss=removed>Cookies are small bits of text that are downloaded to the devices you use to receive our content, products and services and access online information (\\u201c<strong>Cookies<\\/strong>\\u201d). Your browser makes these Cookies available every time you visit the Website again, so it can recognise you and can then tailor what you see on your device.<\\/p>\\r\\n<p xss=removed>VOCALCHIMP.COM uses the following Cookies on this Website:<\\/p>\\r\\n<p xss=removed>a) Session Cookies and Persistent Cookies<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>\\u2013 Session Cookies are temporary cookie files that reset after you close your browser. The Website will not recognize you when you restart your browser and go back to the site that created the cookie. Session Cookies will store your browsing information and are active only from the moment you open the site until you leave it and close your browser.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>\\u2013 Persistent Cookies (known also as \\u201cstored Cookies\\u201d) are files that are stored on your hard drive when you visit the Website. The cookie will remain on your hard drive until it reaches expiration date.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed>b) First-party Cookies and Third-party Cookies<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>\\u2013 First-party Cookies are those set by the website that is being visited. Third-party Cookies are Cookies that are set by a domain other than that of the website being visited by the user.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>\\u2013 VOCALCHIMP.COM may use third-party analytics Cookies that allow us to improve our Website and services, through the analysis of the users\\u2019 activity.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>\\u2013 VOCALCHIMP.COM may use third-party marketing Cookies in order to monitor your browsing activity on the Website.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed><strong>b) What do we use Cookies for?<\\/strong><\\/p>\\r\\n<p xss=removed>The use of Cookies on our Website is broken down into four (4) categories and are primarily used for the purposes described below:<\\/p>\\r\\n<p xss=removed>i.Strictly Necessary Cookies<\\/p>\\r\\n<p xss=removed>The use is essential for the basic functions of the Website or to provide the content, product or service which is requested by you.<\\/p>\\r\\n<p xss=removed>If these Cookies are not in place, the requested content, products or services asked for will not be able to be provided.<\\/p>\\r\\n<p xss=removed>An example of this would be keeping yourself logged in after you have signed up to an account with us. If the Cookies are not provided you will need to log in during each visit.<\\/p>\\r\\n<p xss=removed>ii. Functionality Cookies<\\/p>\\r\\n<p xss=removed>The use improves your browsing experience.<\\/p>\\r\\n<p xss=removed>Functionality Cookies allow the Website to remember preferences and choices you make, such as your language or region.<\\/p>\\r\\n<p xss=removed>Some examples include but are not limited to the below:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>remembering your marketing and advertising preferences, such as choosing whether you wish to receive marketing and advertising information;<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>remembering if you have been to the Website before.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed>Iii. Third-party Analytics Cookies (Google Analytics)<\\/p>\\r\\n<p xss=removed>This Website uses Google Analytics, a service of web traffic analysis designed by Google, Inc. (\\u201c<strong>Google<\\/strong>\\u201d). Google Analytics uses Cookies in order to analyze aggregate usage and volume statistical information on how the users are browsing our Website, with the objective of interpreting and optimizing the Website\\u2019s performance. Google collects information on users\\u2019 activity including page views, the site path of users, source and time spent on the Website.<\\/p>\\r\\n<p xss=removed>For more information on the Privacy Policy provided by Google with regard to the Google Analytics service, you may visit <a href=\\\"https:\\/\\/marketingplatform.google.com\\/about\\/\\\">https:\\/\\/marketingplatform.google.com\\/about\\/<\\/a>. You may find more detailed information regarding Google\\u2019s data protection policies on the website <a href=\\\"https:\\/\\/policies.google.com\\/privacy\\\">https:\\/\\/policies.google.com\\/privacy<\\/a>.<\\/p>\\r\\n<p xss=removed>iv. Advertising and marketing Cookies<\\/p>\\r\\n<p xss=removed>We may allow our business partners to use Advertising Cookies or other similar technologies on the Website to serve you with advertisement that may be relevant to you or your interests.<\\/p>\\r\\n<p xss=removed>Marketing Cookies aim at creating profiles of the users and thereby to send advertising messages in line with the preferences shown by the users during their navigation on the Website and\\/or other websites and applications. Such preferences derive from the analysis of the behaviour of users to build a profile which is combined with the cookie in order to allow adds and advertisements to be tailored to the user\\u2019s presumed preferences or other targeted contents. The information is collected by referencing to the Internet Protocol address (IP) of the users, so they do not identify you personally, even if they may include information about the country and city you are in, together with the details of your internet service provider.<\\/p>\\r\\n<p xss=removed>The information collected may include users\\u2019 behaviour, such as pages visited, emails clicked, forms completed, and products and services purchased to create customized advertisements and communications that better meet your needs, as well as to compile activity reports.<\\/p>\\r\\n<p xss=removed><strong>c) How do I control the use of Cookies? (Opt-in and Opt-out)<\\/strong><\\/p>\\r\\n<p xss=removed>Third-party analytics Cookies and marketing Cookies can be installed only with your prior consent. You may give your consent and accept the Cookies through the banner displayed in the homepage of our Website. In the event you do not accept third-party analytics Cookies and marketing Cookies, this does not mean you will stop seeing advertisements, but you will see advertisements which will not be relevant or targeted to you based on your browsing behaviour.<\\/p>\\r\\n<p xss=removed>Your prior consent is not mandatory for the use of strictly necessary and functionality Cookies since they are considered \\u201ctechnical Cookies\\u201d. At any time, you may disable Cookies by changing your browser\\u2019s settings. As technical Cookies allow you to access some of our Website\\u2019s features, you should be aware that if these Cookies are disabled, you may experience reduced functionality or be prevented from using this Website.<\\/p>\\r\\n<p xss=removed>As to Google Analytics Cookies, you can opt out using the tool made available by Google at <a href=\\\"https:\\/\\/tools.google.com\\/dlpage\\/gaoptout\\\">https:\\/\\/tools.google.com\\/dlpage\\/gaoptout<\\/a>.<\\/p>\\r\\n<p xss=removed>It may also be possible for you to disable Cookies by configuring your browser settings to enable acceptance of specific Cookies or to notify you each time a new Cookie is about to be stored on your computer thus enabling you to decide whether to accept or reject the Cookie. You can manage your use of Cookies through your browser\\u2019s settings.<\\/p>\\r\\n<p xss=removed>You can find here below the links to the instructions of the most common browsers:<\\/p>\\r\\n<p xss=removed><a href=\\\"https:\\/\\/support.microsoft.com\\/en-us\\/help\\/17442\\/windows-internet-explorer-delete-manage-cookies\\\">Internet Explorer<\\/a><\\/p>\\r\\n<p xss=removed><a href=\\\"https:\\/\\/support.google.com\\/chrome\\/answer\\/95647?hl=en\\\">Chrome<\\/a><\\/p>\\r\\n<p xss=removed><a href=\\\"https:\\/\\/support.mozilla.org\\/en-US\\/kb\\/enable-and-disable-cookies-website-preferences\\\">Firefox<\\/a><\\/p>\\r\\n<p xss=removed><a href=\\\"https:\\/\\/support.apple.com\\/kb\\/PH17191\\\">Safari<\\/a><\\/p>\\r\\n<p xss=removed><strong>d) Web Beacons and Pixel Tags<\\/strong><\\/p>\\r\\n<p xss=removed>In addition to Cookies, VOCALCHIMP.COM and some third parties may also use web beacons and pixel tags on websites. A web beacon is usually an electronic graphic image embedded into a website or email to identify your device cookies when you browse the website or email. Pixel tags allow VOCALCHIMP.COM to send emails in a way that is readable to you and find out whether an email is opened.<\\/p>\\r\\n<p xss=removed>VOCALCHIMP.COM and some third parties may use these technologies for various purposes, including analysing service usage (together with Cookies) and providing more satisfactory content and advertisements to you. For example, when you receive an email from VOCALCHIMP.COM, it may contain a click-through URL which links to a VOCALCHIMP.COM web page. If you click the link, VOCALCHIMP.COM will track your visit to help us learn about your preferences for products and services and improve our customer service. You can unsubscribe from the mailing list of VOCALCHIMP.COM at any time if you do not want to be tracked in this manner.<\\/p>\\r\\n<p xss=removed><strong>e) Will this Cookie Policy change?<\\/strong><\\/p>\\r\\n<p xss=removed>We reserve the right to change the terms of this Cookie Policy at any time when necessary to reflect changes in our use of the same, how we process Personal Data, or applicable law. When we make changes, we will revise the \\u201clast updated\\u201d date at the bottom of the policy. If there are material changes to this statement, we will provide notice or obtain consent regarding such changes as may be required by law. We encourage you to review this Cookie Policy whenever you visit the Website.<\\/p>\\r\\n<p xss=removed><strong>f) Privacy Policy and Contact Information<\\/strong><\\/p>\\r\\n<p xss=removed>More information on the processing of your Personal Data, including the exercise of your rights and our contact details, are available in our Privacy Policy If you have a privacy concern, complaint, or question, you can contact us by sending in your query to info@vocalchimp.com<\\/p>\\r\\n<h2 xss=removed>Information collection and use<\\/h2>\\r\\n<p xss=removed>While using our service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information (\\u201cpersonal information\\u201d) may include, but is not limited to:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Name<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Email address<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>