 of every site you visit.<\\/p>\\r\\n<p xss=removed>We have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.<\\/p>\\r\\n<h2 xss=removed>Children\\u2019s privacy<\\/h2>\\r\\n<p xss=removed>Our service does not address anyone under the age of 18 (\\u201cchildren\\u201d).<\\/p>\\r\\n<p xss=removed>We do not knowingly collect personally identifiable information from children under 18. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us. If we discover that a child under 18 has provided us with personal information, we will delete such information from our servers immediately.<\\/p>\\r\\n<h2 xss=removed>Compliance with laws<\\/h2>\\r\\n<p xss=removed>We will disclose your personal information where required to do so by law or subpoena.<\\/p>\\r\\n<h2 xss=removed>Changes to this privacy policy<\\/h2>\\r\\n<p xss=removed>We may update our privacy policy from time to time. We will notify you of any changes by posting the new privacy policy on this page.<\\/p>\\r\\n<p xss=removed>You are advised to review this privacy policy periodically for any changes. Changes to this privacy policy are effective when they are posted on this page.<\\/p>\\r\\n<h2 xss=removed>Contact us<\\/h2>\\r\\n<p xss=removed>If you have any questions about this privacy policy, please contact us.<\\/p>\\r\\n<h2 xss=removed>Accounts<\\/h2>\\r\\n<p xss=removed>When you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the terms, which may result in immediate termination of your account on our service.<\\/p>\\r\\n<p xss=removed>You are responsible for safeguarding the password that you use to access the service and for any activities or actions under your password, whether your password is with our service or a third-party service.<\\/p>\\r\\n<p xss=removed>You agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.<\\/p>\\r\\n<h2 xss=removed>Billing and refund policy<\\/h2>\\r\\n<p xss=removed>When you create an account with us, you must provide us billing information as credit card, debit card, paypal or any other method we require payment.<\\/p>\\r\\n<p xss=removed>Upon payment acceptance your account will be active if you follow the usage rules and regulations.<\\/p>\\r\\n<p xss=removed>You can cancel your account any time from your user dashboard.<\\/p>\\r\\n<p xss=removed>You pay for the month\\u2019s billing and usage in advance of the usage of the account.<\\/p>\\r\\n<p xss=removed>The account automatically renews on the anniversary of the billing date (monthly or annually).<\\/p>\\r\\n<p xss=removed>We will refund ANY and ALL accounts within the first 30 days of using the system without question. If there is an issue with the system past the 30 days we will consider a refund on a individual account basis. Please contact us at info@vocalchimp.com.<\\/p>\\r\\n<p xss=removed><strong>Eu cookie policy and GDPR<\\/strong><\\/p>\\r\\n<p><div xss=removed><strong xss=removed><strong>What we collect<\\/strong><\\/strong><\\/div><div xss=removed><span xss=removed>we only collect ip address cookies to improve functionaliuty and user enjoyment of vocalchimp.com. No information is analyzed or shared with any third party in relation to your cookies, your account or any other personal information.<\\/span><\\/div><\\/p>\\r\\n<p><div xss=removed><strong xss=removed><strong>Third party<\\/strong><\\/strong><\\/div><div xss=removed><span xss=removed>we will never sell your data, share your data or allow anyone outside of the administration of the website to access your data.<\\/span><\\/div><\\/p>\\r\\n<p><div xss=removed><strong xss=removed><strong>Delete account and all information<\\/strong><\\/strong><\\/div><div xss=removed><span xss=removed>you are able to cancel and remove your data from our servers at any time. You simply need to log into your account click on \\u201cedit profile\\u201d. Click \\u201cdelete account\\u201d. Our admin will completely remove your information from our database. We will complete remove and delete all images, information, email address, name, phone number and any and all information associated with your account.<\\/span><\\/div><\\/p>\\r\\n<p><div xss=removed><strong xss=removed><strong>Where your data is stored<\\/strong><\\/strong><\\/div><div xss=removed><span xss=removed>our hosting company is vocalchimp.com. Bvocalchimp.com headquarters are located in Florida, usa. The information is stored in a cloud database, managed by vocalchimp.com the cloud firewall protects and encrypts your information using the most up to date technology.<\\/span><\\/div><\\/p>\\r\\n<p xss=removed><strong>Google Advertising <\\/strong><\\/p>\\r\\n<p xss=removed>BigLinker.com uses remarketing with Google Analytics to advertise online.<\\/p>\\r\\n<p xss=removed>Third-party vendors, including Google, may show you ads on sites across the Internet.<\\/p>\\r\\n<p xss=removed>BigLinker.com and third-party vendors, including Google, use first-party cookies (such as the Google Analytics cookie) and third-party cookies (such as the DoubleClick cookie) together to inform, optimize, and serve ads based on someone\\u2019s past visits to BigLinker.com<\\/p>\\r\\n<p xss=removed>BigLinker.com and third-party vendors, including Google, use first-party cookies (such as the Google Analytics cookies) and third-party cookies (such as the DoubleClick cookie) together to report how your ad impressions, other uses of ad services, and interactions with these ad impressions and ad services are related to visits to BigLinker.com .<\\/p>\\r\\n<p xss=removed>BigLinker.com uses data from Google\\u2019s Interest-based advertising or 3rd-party audience data (such as age, gender, and interests) with Google Analytics to optimize ads and improve website usability for our target audience.<\\/p>\\r\\n<p xss=removed>By using the following <a href=\\\"https:\\/\\/www.google.com\\/settings\\/ads\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Ads Settings<\\/a>, users can opt-out of Google Analytics for Display Advertising and customize Google Display Network ads. Users are also able to opt-out of sharing data with Google Analytics with the following browser add on: <a href=\\\"https:\\/\\/tools.google.com\\/dlpage\\/gaoptout\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">browser opt-outs<\\/a>.<\\/p>\\r\\n<p xss=removed>If you need a further explanation please email us at link@vocalchimp.com<\\/p>\\r\\n<h2 xss=removed>Privacy Notice for California Residents<\\/h2>\\r\\n<p xss=removed><strong>Effective Date<\\/strong>: March 2018<\\/p>\\r\\n<p xss=removed><strong>Last Reviewed on<\\/strong>: March 2020<\\/p>\\r\\n<p xss=removed>This <strong>Privacy Notice for California Residents<\\/strong> supplements the information contained in our privacy policy above and applies solely to all visitors, users, and others who reside in the State of California (\\u201dconsumers\\u201d or \\u201cyou\\u201d). We adopt this notice to comply with the California Consumer Privacy Act of 2018 (CCPA) and any terms defined in the CCPA have the same meaning when used in this notice.<\\/p>\\r\\n<p xss=removed><strong>Information We Collect<\\/strong><\\/p>\\r\\n<p xss=removed>Our Website collects information that identifies, relates to, describes, references, is capable of being associated with, or could reasonably be linked, directly or indirectly, with a particular consumer or device (\\u201d<strong>personal information<\\/strong>\\u201d). In particular, our website has collected the following categories of personal information from its consumers within the last twelve (12) months:<\\/p>\\r\\n<p xss=removed><strong>Category A:<\\/strong> Identifiers<\\/p>\\r\\n<p xss=removed><strong>Examples:<\\/strong> A real name, Internet Protocol address, email address, or other similar identifiers.<\\/p>\\r\\n<p xss=removed><strong>Collected:<\\/strong> YES<\\/p>\\r\\n<p xss=removed><strong>Category B:<\\/strong> Personal information categories listed in the California Customer Records statute (Cal. Civ. Code \\u00a7 1798.80(e)).<\\/p>\\r\\n<p xss=removed><strong>Examples:<\\/strong> A name, signature, Social Security number, physical characteristics or description, address, telephone number, passport number, driver\\u2019s license or state identification card number, insurance policy number, education, employment, employment history, bank account number, credit card number, debit card number, or any other financial information, medical information, or health insurance information. Some personal information included in this category may overlap with other categories.<\\/p>\\r\\n<p xss=removed><strong>Collected:<\\/strong> NO<\\/p>\\r\\n<p xss=removed><strong>Category C:<\\/strong> Protected classification characteristics under California or federal law.<\\/p>\\r\\n<p xss=removed><strong>Examples:<\\/strong> Age (40 years or older), race, color, ancestry, national origin, citizenship, religion or creed, marital status, medical condition, physical or mental disability, sex (including gender, gender identity, gender expression, pregnancy or childbirth and related medical conditions), sexual orientation, veteran or military status, genetic information (including familial genetic information).<\\/p>\\r\\n<p xss=removed><strong>Collected:<\\/strong> NO<\\/p>\\r\\n<p xss=removed>Personal information does not include:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Publicly available information from government records.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>De-identified or aggregated consumer information.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Information excluded from the CCPA\\u2019s scope, like:<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>health or medical information covered by the Health Insurance Portability and Accountability Act of 1996 (HIPAA) and the California Confidentiality of Medical Information Act (CMIA) or clinical trial data;<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>personal information covered by certain sector-specific privacy laws, including the Fair Credit Reporting Act (FRCA), the Gramm-Leach-Bliley Act (GLBA) or California Financial Information Privacy Act (FIPA), and the Driver\\u2019s Privacy Protection Act of 1994.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed>We obtains the categories of personal information listed above from the following categories of sources:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Directly from you. For example, from forms you complete on our website.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Indirectly from you. For example, from observing your actions on our website or interactions with our advertisers.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed><strong>Use of Personal Information<\\/strong><\\/p>\\r\\n<p xss=removed>We may use, or disclose the personal information we collect for one or more of the following business purposes:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>To fulfill or meet the reason you provided the information. For example, if you share your name and contact information to request a price quote or ask a question about our products or services, we will use that personal information to respond to your inquiry. If you provide your personal information to purchase a product or service, we will use that information to process your payment and facilitate delivery. We may also save your information to facilitate new product orders or process returns.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>To provide you with support and to respond to your inquiries, including to investigate and address your concerns and monitor and improve our responses.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>To respond to law enforcement requests and as required by applicable law, court order, or governmental regulations.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>As described to you when collecting your personal information or as otherwise set forth in the CCPA.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>We will not collect additional categories of personal information or use the personal information we collected for materially different, unrelated, or incompatible purposes without providing you notice.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed><strong>Sharing Personal Information<\\/strong><\\/p>\\r\\n<p xss=removed>We may disclose your personal information to a third party for a business purpose [or sell your personal information, subject to your right to opt-out of those sales (see <em>Personal Information Sales Opt-Out and Opt-In Rights<\\/em>)]. When we disclose personal information for a business purpose, we enter a contract that describes the purpose and requires the recipient to both keep that personal information confidential and not use it for any purpose except performing the contract. [The CCPA prohibits third parties who purchase the personal information we hold from reselling it unless you have received explicit notice and an opportunity to opt-out of further sales.]<\\/p>\\r\\n<p xss=removed><strong>Disclosures of Personal Information for a Business Purpose<\\/strong><\\/p>\\r\\n<p xss=removed>In the preceding twelve (12) months, Company has not disclosed personal information for a business purpose.<\\/p>\\r\\n<p xss=removed><strong>Sales of Personal Information<\\/strong><\\/p>\\r\\n<p xss=removed>In the preceding twelve (12) months, Company had not sold personal information.<\\/p>\\r\\n<p xss=removed><strong>Your Rights and Choices<\\/strong><\\/p>\\r\\n<p xss=removed>The CCPA provides consumers (California residents) with specific rights regarding their personal information. This section describes your CCPA rights and explains how to exercise those rights.<\\/p>\\r\\n<p xss=removed><strong>Access to Specific Information and Data Portability Rights<\\/strong><\\/p>\\r\\n<p xss=removed>You have the right to request that we disclose certain information to you about our collection and use of your personal information over the past 12 months. Once we receive and confirm your verifiable consumer request, we will disclose to you:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>The categories of personal information we collected about you.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>The categories of sources for the personal information we collected about you.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Our business or commercial purpose for collecting or selling that personal information.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>The categories of third parties with whom we share that personal information.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>The specific pieces of personal information we collected about you (also called a data portability request).<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>If we sold or disclosed your personal information for a business purpose, two separate lists disclosing:<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>sales, identifying the personal information categories that each category of recipient purchased; and<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>disclosures for a business purpose, identifying the personal information categories that each category of recipient obtained.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed><strong>Deletion Request Rights<\\/strong><\\/p>\\r\\n<p xss=removed>You have the right to request that we delete any of your personal information that we collected from you and retained, subject to certain exceptions. Once we receive and confirm your verifiable consumer request, we will delete (and direct our service providers to delete) your personal information from our records, unless an exception applies.<\\/p>\\r\\n<p xss=removed>We may deny your deletion request if retaining the information is necessary for us or our service provider(s) to:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Complete the transaction for which we collected the personal information, provide a good or service that you requested, take actions reasonably anticipated within the context of our ongoing business relationship with you, or otherwise perform our contract with you.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Detect security incidents, protect against malicious, deceptive, fraudulent, or illegal activity, or prosecute those responsible for such activities.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Debug products to identify and repair errors that impair existing intended functionality.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Exercise free speech, ensure the right of another consumer to exercise their free speech rights, or exercise another right provided for by law.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Comply with the California Electronic Communications Privacy Act (Cal. Penal Code \\u00a7 1546 et. seq.).<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Engage in public or peer-reviewed scientific, historical, or statistical research in the public interest that adheres to all other applicable ethics and privacy laws, when the information\\u2019s deletion may likely render impossible or seriously impair the research\\u2019s achievement, if you previously provided informed consent.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Enable solely internal uses that are reasonably aligned with consumer expectations based on your relationship with us.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Comply with a legal obligation.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Make other internal and lawful uses of that information that are compatible with the context in which you provided it.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed><strong>Exercising Access, Data Portability, and Deletion Rights<\\/strong><\\/p>\\r\\n<p xss=removed>To exercise the access, data portability, and deletion rights described above, please submit a verifiable consumer request to us by sending us a message on our website. Only you, or a person registered with the California Secretary of State that you authorize to act on your behalf, may make a verifiable consumer request related to your personal information. You may also make a verifiable consumer request on behalf of your minor child.<\\/p>\\r\\n<p xss=removed>You may only make a verifiable consumer request for access or data portability twice within a 12-month period. The verifiable consumer request must:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Provide sufficient information that allows us to reasonably verify you are the person about whom we collected personal information or an authorized representative.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Describe your request with sufficient detail that allows us to properly understand, evaluate, and respond to it.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed>We cannot respond to your request or provide you with personal information if we cannot verify your identity or authority to make the request and confirm the personal information relates to you. We will only use personal information provided in a verifiable consumer request to verify the requestor\\u2019s identity or authority to make the request.<\\/p>\\r\\n<p xss=removed><strong>Response Timing and Format<\\/strong><\\/p>\\r\\n<p xss=removed>We endeavor to respond to a verifiable consumer request within forty-five (45) days of its receipt. If we require more time (up to [45\\/90] days), we will inform you of the reason and extension period in writing. We will deliver our written response by mail or electronically, at your option. Any disclosures we provide will only cover the 12-month period preceding the verifiable consumer request\\u2019s receipt. The response we provide will also explain the reasons we cannot comply with a request, if applicable. For data portability requests, we will select a format to provide your personal information that is readily useable and should allow you to transmit the information from one entity to another entity without hindrance, specifically by electronic mail communication.<\\/p>\\r\\n<p xss=removed>We do not charge a fee to process or respond to your verifiable consumer request unless it is excessive, repetitive, or manifestly unfounded. If we determine that the request warrants a fee, we will tell you why we made that decision and provide you with a cost estimate before completing your request.<\\/p>\\r\\n<p xss=removed><strong>Personal Information Sales Opt-Out and Opt-In Rights<\\/strong><\\/p>\\r\\n<p xss=removed>If you are 16 years of age or older, you have the right to direct us to not sell your personal information at any time (the \\u201cright to opt-out\\u201d). We do not sell the personal information of consumers we actually know are less than 16 years of age, unless we receive affirmative authorization (the \\u201cright to opt-in\\u201d) from either the consumer who is between 13 and 16 years of age, or the parent or guardian of a consumer less than 13 years of age. Consumers who opt-in to personal information sales may opt-out of future sales at any time. To exercise the right to opt-out, you (or your authorized representative) may submit a request to us by visiting the following our webpage and sending us a message.<\\/p>\\r\\n<p xss=removed>Once you make an opt-out request, we will wait at least twelve (12) months before asking you to reauthorize personal information sales. However, you may change your mind and opt back in to personal information sales at any time by visiting our website and sending us a message. We will only use personal information provided in an opt-out request to review and comply with the request.<\\/p>\\r\\n<p xss=removed><strong>Non-Discrimination<\\/strong><\\/p>\\r\\n<p xss=removed>We will not discriminate against you for exercising any of your CCPA rights. Unless permitted by the CCPA, we will not:<\\/p>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Deny you goods or services.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Charge you different prices or rates for goods or services, including through granting discounts or other benefits, or imposing penalties.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Provide you a different level or quality of goods or services.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<ul>\\r\\n<li>\\r\\n<ul>\\r\\n<li xss=removed>Suggest that you may receive a different price or rate for goods or services or a different level or quality of goods or services.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p xss=removed>However, we may offer you certain financial incentives permitted by the CCPA that can result in different prices, rates, or quality levels. Any CCPA-permitted financial incentive we offer will reasonably relate to your personal information\\u2019s value and contain written terms that describe the program\\u2019s material aspects. Participation in a financial incentive program requires your prior opt in consent, which you may revoke at any time.<\\/p>\\r\\n<p xss=removed>California\\u2019s \\u201cShine the Light\\u201d law (Civil Code Section \\u00a7 1798.83) permits users of our Website that are California residents to request certain information regarding our disclosure of personal information to third parties for their direct marketing purposes. To make such a request, please send us an electronic message through our website or write us at our address listed on our webpage.<\\/p>\\r\\n<p xss=removed><strong>Your California Privacy Rights<\\/strong><\\/p>\\r\\n<p xss=removed>If you are a California resident, California law may provide you with additional rights regarding our use of your personal information. To learn more about your California privacy rights, visit <a href=\\\"https:\\/\\/oag.ca.gov\\/privacy\\/privacy-laws\\\">https:\\/\\/oag.ca.gov\\/privacy\\/privacy-laws<\\/a>.<\\/p>\\r\\n<p xss=removed><strong>Notice to European Users<\\/strong><\\/p>\\r\\n<p xss=removed>This Site and the services on this Site are targeted for users in the United States of America. Any information you enter on this Site may be transferred outside of the European Union to the United States of America which does not offer an equivalent level of protection to that required in the European Union. In particular, you are advised that the United States of America uses a sectoral model of privacy protection that relies on a mix of legislation, governmental regulation, and self-regulation. Article 26 of the European Union\\u2019s Data Protection Directive (Directive 95\\/46\\/EC, 1995 O.J. (L 281) 31) allows for transfer of personal data from the European Union to a third country if the individual has unambiguously given his consent to the transfer of personal information, regardless of the third country\\u2019s level of protection. By using this Site or the services, you consent to the transfer of all such information to the United States of America which may not offer an equivalent level of protection to that required in the European Union and to the processing of that information by the Company on its servers located in the United States of America as described in this Privacy Policy.<\\/p>\\r\\n<p xss=removed><strong>Changes to Our Privacy Policy<\\/strong><\\/p>\\r\\n<p xss=removed>It is our policy to post any changes we make to our privacy policy on this page with a notice that the privacy policy has been updated on the Website home page. If we make material changes to how we treat our users\\u2019 personal information, we will notify you through a notice on the Website home page. The date the privacy policy was last revised is identified at the top of the page. You are responsible for ensuring we have an up-to-date active and deliverable email address for you, and for periodically visiting our Website and this privacy policy to check for any changes.<\\/p>\"}',0,1,0,1,0,0,1,'normal',15,0,'{\"version\":\"v2_1\",\"site_key\":\"\",\"secret_key\":\"\"}','G-1P47JGM5MF','{\"google\":{\"enabled\":0,\"client_id\":\"\",\"client_secret\":\"\"},\"facebook\":{\"enabled\":0,\"app_id\":\"\",\"app_secret\":\"\"},\"twitter\":{\"enabled\":0,\"consumer_key\":\"\",\"consumer_secret\":\"\"}}','disabled','{\"host\":\"in-v3.mailjet.com\",\"port\":\"587\",\"is_auth\":1,\"us