ut enter any additional targeting you might find useful.\r\n\r\nClick Save and activate your campaign.\r\n\r\nIt takes 12 to 24 hours until the first campaign goes out to Linkedin.\r\n\r\nOnce your invites go out and people starting accepting them the platform automatically extracts all of their data. This data includes name, email address, phone number, job title, and many other pieces of information. You can download this information as a csv file or connect to any C R M or marketing platform via Zapier.\r\n\r\nWe also extract all of your previous LinkedIn connection’s data prior to signing up at BigLinker.\r\n\r\nFrom this dashboard you can update your Linkedin information if you decide to change passwords or email addresses associated with your LinkedIn account.\r\n\r\nFrom here you can also set up the Email marketing part of the LinkedIn Sales Funnel.\r\n\r\nWhen you click on the list area you will see that your connections are automatically imported and segmented between your connections made using BigLinker and your previous Linkedin Connections.\r\n\r\nYou can set up campaigns both single send and automated drip series using either segments or combine both into 1 campaign.\r\n\r\nWe have amazing tutorials and simple explanations on how to use the system in our Help Center/FAQ’s section.\r\n\r\n\r\nYou can also always email us questions or to set up a demo meeting at info@biglinker.com\r\n\r\nNow, it’s time to create your first campaign!</prosody>',2555,'local','tts_file/user/BwljG548x4a5014bf66ad7f9dfc683b6033e72270glwDSdVHN.mp3','2021-11-20 11:11:42'),(67,'wsYKGcHU9f691de7d63a9962ccf9897e051ec4b9emDyQ8oCvK','0bWHjn9usb065a85cc223037e3b5dff82c4c08fba2XaMlC3Gk','default','azure','neural','en-US','English (US)','en-US-AshleyNeural','Female, Ashley','{\"output_format\":\"mp3\",\"output_volume\":\"default\",\"spk_rate\":\"default\"}','Three steps to connecting your Linkedin account.\r\nStep 1. Read and understand all of the information on screen.\r\nYou must follow the onscreen instructions, or the sign up process will not work.\r\nStep 2.\r\nBefore you fill out the information Go to your account on Linkedin.com.\r\nYou MUST 100% know your username and password.\r\nLogin to your account.\r\nIf you are logged in then go to the upper right hand corner and click on \"Settings and privacy\".\r\nThen go to Sign In and Security.\r\nCheck that the email you are connecting to BigLinker is your primary email address.\r\nGo back to LinkedIn.\r\nClick Sign Out.\r\nClick Sign in using a different account.\r\nMake sure you manually, with your fingers, type in your username and password.\r\nOnce you are in your Linkedin account you know your username and password.\r\nNow you can return to BigLinker.com to complete the connection of your LinkedIn account to BigLinker.com.',908,'local','tts_file/user/wsYKGcHU9f691de7d63a9962ccf9897e051ec4b9emDyQ8oCvK.mp3','2021-12-06 13:46:03'),(68,'9v0h5UnX70d4b0ad3fac19687cebe36df668472b0rn2x5hpwA','0bWHjn9usb065a85cc223037e3b5dff82c4c08fba2XaMlC3Gk','default','azure','neural','en-US','English (US)','en-US-AshleyNeural','Female, Ashley','{\"output_format\":\"mp3\",\"output_volume\":\"default\",\"spk_rate\":\"default\"}','Follow the onscreen instructions.<break time=\"1s\">\r\n\r\nEnter your name, Linked In username and password. <break time=\"1s\">\r\n\r\nThis may be different than the username and password used to sign up for BigLinker.<break time=\"1s\">\r\n\r\nRemember to NEVER copy and paste your username and password. Always manually type in the information.<break time=\"1s\">\r\n\r\nYour account will process. It can take up to 1 minute for it to process.<break time=\"1s\">\r\n\r\nIf you are required to enter a PIN code.<break time=\"1s\">\r\n\r\nLinkedin will email you a PIN code directly to the email account associated with your Linkedin profile. <break time=\"1s\">\r\nThis may be a different email than what you used to set up your initial BigLinker account with.',730,'local','tts_file/user/9v0h5